const PulseCircle = ({ locationPosition, color }) => (
  <svg
    xmlns="http://www.w3.org/2000/svg"
    preserveAspectRatio="xMidYMid meet"
    viewBox="0 0 40 40"
  >
    <circle
      cx="20"
      cy="20"
      r="10"
      fill="none"
      stroke="hsl(337, 100%, 24%)"
      strokeWidth="2"
    >
      <animate
        attributeName="r"
        begin="0s"
        dur="1.5s"
        from="8"
        repeatCount="indefinite"
        to="20"
      ></animate>
      <animate
        attributeName="opacity"
        begin="0s"
        dur="1.5s"
        from="1"
        repeatCount="indefinite"
        to="0"
      ></animate>
    </circle>
    <circle cx="20" cy="20" r="10" fill={color || "hsl(43, 87%, 50%)"} />
    {locationPosition && (
      <text
        className="text-monospace"
        x="50%"
        y="50%"
        textAnchor="middle"
        dy="0.125rem"
        fontSize="16"
      >
        {locationPosition}
      </text>
    )}
  </svg>
);

const StoreCircle = ({ active = false, colors }) => (
  <svg
    xmlns="http://www.w3.org/2000/svg"
    preserveAspectRatio="xMidYMid meet"
    viewBox="0 0 40 40"
  >
    <circle
      cx="20"
      cy="20"
      r="10"
      fill={active ? colors.strokeColor : colors.backgroundColor}
      strokeColor={colors.strokeColor}
      strokeWidth="1"
    />
  </svg>
);

const NzMap = ({ locations, currentSlideData, activeStore, isActive }) => {
  const isNumber = locations?.length > 1;

  return (
    <div className="nzMap" style={{ position: "relative" }}>
      {isActive ? (
        <Fragment>
          <NZmapBackground />
          {currentSlideData?.length > 0 &&
            currentSlideData.map((location, index) => {
              const {
                graphData: {
                  storeData: {
                    latLong: { top, left, lat, lon },
                    name
                  },
                  strokeColor,
                  backgroundColor
                }
              } = location;

              const position = {
                top: `${top}%`,
                left: `${left}%`
              };
              const colors = {
                strokeColor,
                backgroundColor
              };

              const isActiveStore = activeStore === name;
              const size = isActiveStore ? "1rem" : "0.5rem";
              return (
                <div
                  key={`${lat}_${lon}_${index}_store`}
                  style={{
                    position: "absolute",
                    width: size,
                    height: size,
                    ...position,
                    transform: "translate(-50%, -50%)"
                  }}
                >
                  <StoreCircle colors={colors} active={isActiveStore} />
                </div>
              );
            })}
          {locations?.length > 0 &&
            locations.map((location, index) => {
              const {
                storeData: {
                  latLong: { top, left, lat, lon }
                },
                strokeColor
              } = location;
              const position = {
                top: `${top}%`,
                left: `${left}%`
              };

              const locationPosition = isNumber ? index + 1 : null;

              return (
                <div
                  key={`${lat}_${lon}_${index}_pulse`}
                  style={{
                    position: "absolute",
                    width: "2rem",
                    height: "2rem",
                    ...position,
                    transform: "translate(-50%, -50%)"
                  }}
                >
                  <PulseCircle
                    locationPosition={locationPosition}
                    color={strokeColor}
                  />
                </div>
              );
            })}
        </Fragment>
      ) : (
        <NZmapOverlay />
      )}
    </div>
  );
};

export default NzMap;
